  this_descr = PyDescr_NewGetSet(SwigPyObject_type(), &this_getset_def);
  (void)this_descr;

  /* All objects have a 'thisown' attribute */
  thisown_descr = PyDescr_NewGetSet(SwigPyObject_type(), &thisown_getset_def);
  (void)thisown_descr;

  public_interface = PyList_New(0);
  public_symbol = 0;
  (void)public_symbol;

  PyDict_SetItemString(md, "__all__", public_interface);
  Py_DECREF(public_interface);
  for (i = 0; SwigMethods[i].ml_name != NULL; ++i)
  SwigPyBuiltin_AddPublicSymbol(public_interface, SwigMethods[i].ml_name);
  for (i = 0; swig_const_table[i].name != 0; ++i)
  SwigPyBuiltin_AddPublicSymbol(public_interface, swig_const_table[i].name);
#endif

  SWIG_InstallConstants(d,swig_const_table);

  SWIG_Python_SetConstant(d, "CGATOOLS_UTIL_MD5_HPP_",SWIG_From_int(static_cast< int >(1)));
  SWIG_Python_SetConstant(d, "CGATOOLS_REFERENCE_RANGE_HPP_",SWIG_From_int(static_cast< int >(1)));
  SWIG_Python_SetConstant(d, "CGATOOLS_REFERENCE_COMPACTDNASEQUENCE_HPP_",SWIG_From_int(static_cast< int >(1)));
  SWIG_Python_SetConstant(d, "CGATOOLS_REFERENCE_CRRFILE_HPP_",SWIG_From_int(static_cast< int >(1)));
